                if (!Arrays.AreEqual(sigDerived, sig))
                {
                    Fail("different signatures of message; expected=" + Hex.ToHexString(sig) + " actual="
                        + Hex.ToHexString(sigDerived));
                }

                signer.Init(false, pub);
                signer.BlockUpdate(msg, 0, msg.Length);
                bool shouldVerify = signer.VerifySignature(sig);

                IsTrue("signature verification failed for test vector: " + error, shouldVerify);
            }
        }
    }
}
